(10010,	538,	'biog',	'This only brings us to the margins of a musical map that also includes The Beach Boys, Nigerian funk, krautrock and 1940s British noir fiction. Capistranoway’s debut album, 1, 2 Kung Fu, is piloted by Davey Newington, a young man with much musical heritage. One of his granddads was a jazzer who played drums for the Royal Marines. Davey’s dad (violin) and his mum (clarinet) both played, and met, in the BBC National Orchestra Of Wales. Davey himself also enjoyed orchestral engagement, playing triangle for the National Youth Orchestra Of Wales.\n\nhttps://www.youtube.com/watch?v=9E-d4VPt6cE'),
