(10102,	558,	'biog',	'<p class=\"p1\">This artist is a 19 year old singer/songwriter from Croydon and is the youngest in a large family, and the only child born in England rather than her native Zimbabwe. Her family’s traditional Zimbabwean values meant she sometimes felt isolated from her cultural surroundings. She found solace in writing and recording music. Her limited exposure to pop music and her self taught singing/guitar meant she developed a totally unique style.</p>\r\nhttps://www.youtube.com/watch?v=9E-d4VPt6cE'),
