(10138,	560,	'biog',	'<p class=\"p1\">Family has always been front-and-centre for this artist. His breakthrough 2014 EP was inspired by the funk, soul and hip-hop tapes his mum used to play in the car. Spreading organically on the strength of the music, the record finished the year on a plethora of ‘Best of the Year’ lists including Pitchfork, FACT and Resident Advisor.</p>\nhttps://www.youtube.com/watch?v=7vT4mlW4UY4'),
